import React from 'react'
import './Header.css';
import '../style.css';


export default function openModal() {
  // function openModal() {
  const temp = document.getElementById("modalWindow");
  if (!temp) {
    //модальное окно само
    const backgroundDiv = document.createElement("div");
    backgroundDiv.setAttribute("id", "modalWindow");
    backgroundDiv.setAttribute(
      "className=",
      "position:fixed; top:0; left:0; display: flex; width:100vw; height:100vh; justify-content:center; padding-top: 30px; z-index:1; background-color: rgba(0, 0, 0, 0.7);"
    );
    // backgroundDiv.setAttribute("onclick", "closeModal()");     align-items:center;

    //белый бекграунд
    const modalWinDiv = window.document.createElement("div");
    modalWinDiv.setAttribute(
      "className=",
      "width:800px; height:600px; background-color:#E5E5E5; justify-content:center; border-radius:20px;"
    );
    //надпись сверху
    const modalTitleDiv = window.document.createElement("div");
    const modalTitle = window.document.createElement("p");
    modalTitleDiv.setAttribute(
      "className=",
      "font-weight: bold;  color: black;  font-size: 35px;  justify-conten:center;  text-align: center;"
    );
    modalTitle.innerHTML = "Choose a Tier that's right for you";
    modalTitleDiv.appendChild(modalTitle);
    modalWinDiv.appendChild(modalTitleDiv);
    //див с билетов
    const modalTicketsDiv = window.document.createElement("div");
    modalTicketsDiv.setAttribute(
      "className=",
      "display: flex;width: 100%; height: 74%; text-align: center; justify-content: space-between; padding: 10px;box-sizing: border-box;"
    );

    //дивы с видами билетов
    //basic
    modalTicketBasicDiv = window.document.createElement("div");
    modalTicketBasicDiv.setAttribute("class", "ticket");
    modalTicketBasicDiv.setAttribute("className=", "color: Black");

    modalTicketBasicNameDiv = window.document.createElement("div");
    modalTicketBasicNameDiv.setAttribute("class", "ticket-name");
    const modalTextBasic1 = window.document.createElement("p");
    modalTextBasic1.innerHTML = "Basic";
    modalTicketBasicNameDiv.appendChild(modalTextBasic1);

    modalTicketBasicCostDiv = window.document.createElement("div");
    modalTicketBasicCostDiv.setAttribute("class", "ticket-cost");
    const modalTextBasic2 = window.document.createElement("p");
    modalTextBasic2.innerHTML = "100$";
    modalTicketBasicCostDiv.appendChild(modalTextBasic2);

    modalTicketBasicSeatDiv = window.document.createElement("div");
    modalTicketBasicSeatDiv.setAttribute("class", "ticket-suggest-yes");
    const modalTextBasic3 = window.document.createElement("p");
    modalTextBasic3.innerHTML = "1 Seat Available";
    modalTicketBasicSeatDiv.appendChild(modalTextBasic3);

    modalTicketBasicWifiDiv = window.document.createElement("div");
    modalTicketBasicWifiDiv.setAttribute("class", "ticket-suggest-no");
    const modalTextBasic4 = window.document.createElement("p");
    modalTextBasic4.innerHTML = "Access to WiFi Router";
    modalTicketBasicWifiDiv.appendChild(modalTextBasic4);

    modalTicketBasicFoodDiv = window.document.createElement("div");
    modalTicketBasicFoodDiv.setAttribute("class", "ticket-suggest-no");
    const modalTextBasic5 = window.document.createElement("p");
    modalTextBasic5.innerHTML = "Free Food & Coffee";
    modalTicketBasicFoodDiv.appendChild(modalTextBasic5);

    modalTicketBasicDiv.appendChild(modalTicketBasicNameDiv);
    modalTicketBasicDiv.appendChild(modalTicketBasicCostDiv);
    modalTicketBasicDiv.appendChild(modalTicketBasicSeatDiv);
    modalTicketBasicDiv.appendChild(modalTicketBasicWifiDiv);
    modalTicketBasicDiv.appendChild(modalTicketBasicFoodDiv);

    modalTicketsDiv.appendChild(modalTicketBasicDiv);


    //standart
    modalTicketStandartDiv = window.document.createElement("div");
    modalTicketStandartDiv.setAttribute("className", "ticket color: #381DDB");

    modalTicketStandartNameDiv = window.document.createElement("div");
    modalTicketStandartNameDiv.setAttribute("className", "ticket-name");
    const modalTextStandart1 = window.document.createElement("p");
    modalTextStandart1.innerHTML = "Standart";
    modalTicketStandartNameDiv.appendChild(modalTextStandart1);

    modalTicketStandartCostDiv = window.document.createElement("div");
    modalTicketStandartCostDiv.setAttribute("className", "ticket-cost");
    const modalTextStandart2 = window.document.createElement("p");
    modalTextStandart2.innerHTML = "150$";
    modalTicketStandartCostDiv.appendChild(modalTextStandart2);

    modalTicketStandartSeatDiv = window.document.createElement("div");
    modalTicketStandartSeatDiv.setAttribute("className", "ticket-suggest-yes");
    const modalTextStandart3 = window.document.createElement("p");
    modalTextStandart3.innerHTML = "1 Seat Available";
    modalTicketStandartSeatDiv.appendChild(modalTextStandart3);

    modalTicketStandartWifiDiv = window.document.createElement("div");
    modalTicketStandartWifiDiv.setAttribute("className", "ticket-suggest-yes");
    const modalTextStandart4 = window.document.createElement("p");
    modalTextStandart4.innerHTML = "Access to WiFi Router";
    modalTicketStandartWifiDiv.appendChild(modalTextStandart4);

    modalTicketStandartFoodDiv = window.document.createElement("div");
    modalTicketStandartFoodDiv.setAttribute("className", "ticket-suggest-no");
    const modalTextStandart5 = window.document.createElement("p");
    modalTextStandart5.innerHTML = "Free Food & Coffee";
    modalTicketStandartFoodDiv.appendChild(modalTextStandart5);

    modalTicketStandartDiv.appendChild(modalTicketStandartNameDiv);
    modalTicketStandartDiv.appendChild(modalTicketStandartCostDiv);
    modalTicketStandartDiv.appendChild(modalTicketStandartSeatDiv);
    modalTicketStandartDiv.appendChild(modalTicketStandartWifiDiv);
    modalTicketStandartDiv.appendChild(modalTicketStandartFoodDiv);

    modalTicketsDiv.appendChild(modalTicketStandartDiv);



    //Premium
    modalTicketPremiumDiv = window.document.createElement("div");
    modalTicketPremiumDiv.setAttribute("className", "ticket color: #FC5252");

    modalTicketPremiumNameDiv = window.document.createElement("div");
    modalTicketPremiumNameDiv.setAttribute("className", "ticket-name");
    const modalTextPremium1 = window.document.createElement("p");
    modalTextPremium1.innerHTML = "Premium";
    modalTicketPremiumNameDiv.appendChild(modalTextPremium1);

    modalTicketPremiumCostDiv = window.document.createElement("div");
    modalTicketPremiumCostDiv.setAttribute("className", "ticket-cost");
    const modalTextPremium2 = window.document.createElement("p");
    modalTextPremium2.innerHTML = "200$";
    modalTicketPremiumCostDiv.appendChild(modalTextPremium2);

    modalTicketPremiumSeatDiv = window.document.createElement("div");
    modalTicketPremiumSeatDiv.setAttribute("className", "ticket-suggest-yes");
    const modalTextPremium3 = window.document.createElement("p");
    modalTextPremium3.innerHTML = "2 Seat Available";
    modalTicketPremiumSeatDiv.appendChild(modalTextPremium3);

    modalTicketPremiumWifiDiv = window.document.createElement("div");
    modalTicketPremiumWifiDiv.setAttribute("className", "ticket-suggest-yes");
    const modalTextPremium4 = window.document.createElement("p");
    modalTextPremium4.innerHTML = "Access to WiFi Router";
    modalTicketPremiumWifiDiv.appendChild(modalTextPremium4);

    modalTicketPremiumFoodDiv = window.document.createElement("div");
    modalTicketPremiumFoodDiv.setAttribute("className", "ticket-suggest-yes");
    const modalTextPremium5 = window.document.createElement("p");
    modalTextPremium5.innerHTML = "Free Food & Coffee";
    modalTicketPremiumFoodDiv.appendChild(modalTextPremium5);

    modalTicketPremiumDiv.appendChild(modalTicketPremiumNameDiv);
    modalTicketPremiumDiv.appendChild(modalTicketPremiumCostDiv);
    modalTicketPremiumDiv.appendChild(modalTicketPremiumSeatDiv);
    modalTicketPremiumDiv.appendChild(modalTicketPremiumWifiDiv);
    modalTicketPremiumDiv.appendChild(modalTicketPremiumFoodDiv);

    modalTicketsDiv.appendChild(modalTicketPremiumDiv);
    //див кнопка закрытия
    const modalButtonDiv = window.document.createElement("div");
    modalButtonDiv.setAttribute(
      "className",
      "margin:0px 20px 20px 0px; align-self:flex-end;"
    );
    const modalButton = window.document.createElement("button");
    modalButton.innerHTML = "Закрыть";
    modalButton.setAttribute(
      "className",
      "margin-left: 87%; width:100px; height:38px; background-color:#0078D2; border:none; border-radius:10px; color:#fff;"
    );

    modalButton.setAttribute("onclick", "closeModal()");
    modalButtonDiv.appendChild(modalButton);

    modalWinDiv.appendChild(modalTicketsDiv);
    modalWinDiv.appendChild(modalButtonDiv);

    backgroundDiv.appendChild(modalWinDiv);

    function closeModal() {
    document.body.removeChild(document.getElementById("modalWindow"));
    }

    
  }
  return (
    <backgroundDiv />
  )
}
